import React from "react";
import { Navigate, Routes, Route } from "react-router-dom";
import Register from "./components/SignUp";

function App() {
  return (
    <>
      <Routes>
        <Route path='/register' element={<Register/>}/>
      </Routes>
    </>
  );
};

export default App;
